import React from "react";
import InputGroup from 'react-bootstrap/InputGroup';
import Form from 'react-bootstrap/Form';

let AppTodo = () => {
    return (
        <div className="App">
            <div className="container">
            <InputGroup className="mb-3">
                <Form.Control
                placeholder="Username"
                aria-label="Username"
                />
            </InputGroup>  
                <div className="list">
                    <ui>
                        <li></li>
                    </ui>
                </div>
            </div>
        </div>
    )
}

export default AppTodo
